import React from "react"
import {HeaderBlock, HeaderSection, HeaderMenuBlock, HeaderMenuItem} from "./styles";

const AppHeader = () => {
    return (
        <HeaderBlock>
            <HeaderSection>1</HeaderSection>
            <HeaderSection>
                <HeaderMenuBlock>
                    <HeaderMenuItem>1</HeaderMenuItem>
                    <HeaderMenuItem>2</HeaderMenuItem>
                    <HeaderMenuItem>3</HeaderMenuItem>
                    <HeaderMenuItem>4</HeaderMenuItem>
                    <HeaderMenuItem>5</HeaderMenuItem>
                </HeaderMenuBlock>
            </HeaderSection>
        </HeaderBlock>
    )
};

export default AppHeader
